import React, { useState } from "react";
import styles from "./Main.module.css";
import Button from "../../ui/button/Button";
import Input from "../../ui/input/Input";
import OptionList from "../../ui/optionList/OptionList";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faUser,
  faCompactDisc,
  faMusic,
  faClock,
  faHourglassEnd,
} from "@fortawesome/free-solid-svg-icons";
import TimeSelectionRow from "../../ui/timeSelectionRow/TimeSelectionRow";

export interface FormData {
  artist: string;
  album: string;
  track: string;
  startTimestamp: string;
  endTimestamp: string;
}

interface Options {
  name: string;
  value?: string;
}

interface Main {
    userID?: string;
}
const useForm = (initialState: FormData) => {
  const [formData, setFormData] = useState<FormData>(initialState);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleOptionSelect = (type: keyof FormData, option: Options) => {
    setFormData((prevState) => ({
      ...prevState,
      [type]: option.name,
    }));
  };

  return {
    formData,
    handleChange,
    handleOptionSelect,
  };
};

const Main: React.FC = () => {
  const initialState: FormData = {
    artist: "",
    album: "",
    track: "",
    startTimestamp: "",
    endTimestamp: "",
  };

  const [options, setOptions] = useState<{
    artists: Options[];
    albums: Options[];
    tracks: Options[];
  }>({
    artists: [],
    albums: [],
    tracks: [],
  });

  const { formData, handleChange, handleOptionSelect } = useForm(initialState);

  const handleSubmit = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <section>
      <h2>Home</h2>
      <form onSubmit={handleSubmit} className={styles.form}>
        <table className={styles.inputTable}>
          <tbody>
            <tr>
              <td>
                <FontAwesomeIcon icon={faUser} />
              </td>
              <td>Artist</td>
              <td>
                <Input
                  id="artist"
                  type="text"
                  name="artist"
                  value={formData.artist}
                  onChange={handleChange}
                  placeholder="Enter artist name"
                />
              </td>
              <td>
                <OptionList
                  options={options.artists}
                  onSelect={(option) => handleOptionSelect("artist", option)}
                />
              </td>
            </tr>
            <tr>
              <td>
                <FontAwesomeIcon icon={faCompactDisc} />
              </td>
              <td>Album</td>
              <td>
                <Input
                  id="album"
                  type="text"
                  name="album"
                  value={formData.album}
                  onChange={handleChange}
                  placeholder="Enter album title"
                />
              </td>
              <td>
                <OptionList
                  options={options.albums}
                  onSelect={(option) => handleOptionSelect("album", option)}
                />
              </td>
            </tr>
            <tr>
              <td>
                <FontAwesomeIcon icon={faMusic} />
              </td>
              <td>Track</td>
              <td>
                <Input
                  id="track"
                  type="text"
                  name="track"
                  value={formData.track}
                  onChange={handleChange}
                  placeholder="Enter track name"
                />
              </td>
              <td>
                <OptionList
                  options={options.tracks}
                  onSelect={(option) => handleOptionSelect("track", option)}
                />
              </td>
            </tr>
            <tr>
              <td>
                <FontAwesomeIcon icon={faClock} />
              </td>
              <td>Start Time</td>
              <td>
                <Input
                  id="startTimestamp"
                  type="datetime-local"
                  name="startTimestamp"
                  value={formData.startTimestamp}
                  onChange={handleChange}
                  placeholder="Start timestamp"
                />
              </td>
              <td>
                <TimeSelectionRow
                  label="Start Time"
                  timestamp={formData.startTimestamp}
                  onChange={handleChange}
                  onYearSelect={(year) =>
                    handleOptionSelect("startTimestamp", {
                      name: `${year}-01-01T00:00`,
                      value: "",
                    })
                  }
                />
              </td>
            </tr>
            <tr>
              <td>
                <FontAwesomeIcon icon={faHourglassEnd} />
              </td>
              <td>End Time</td>
              <td>
                <Input
                  id="endTimestamp"
                  type="datetime-local"
                  name="endTimestamp"
                  value={formData.endTimestamp}
                  onChange={handleChange}
                  placeholder="End timestamp"
                />
              </td>
              <td>
                <TimeSelectionRow
                  label="End Time"
                  timestamp={formData.endTimestamp}
                  onChange={handleChange}
                  onYearSelect={(year) =>
                    handleOptionSelect("endTimestamp", {
                      name: `${year}-01-01T00:00`,
                      value: "",
                    })
                  }
                />
              </td>
            </tr>
            <tr>
              <td></td>
              <td></td>
              <td>
                <Button type="submit">Submit</Button>
              </td>
            </tr>
          </tbody>
        </table>
      </form>
      <div id="results" className={styles.results}></div>
    </section>
  );
};

export default Main;
